import React, { useState } from 'react'

export default function BinaryNum() {
    const [number,setNumber]=useState(0)
    const time = Math.floor(Math.random() * (10000 - 1000 + 1)) + 1000;
    setTimeout(()=>{
        if(number===0){
            setNumber(1)
        }else{
            setNumber(0)
        }
    },time)
  return (
    <div>
      {number}
    </div>
  )
}
